/////////
///////// SETUP
/////////

// Scene
let scene = new THREE.Scene();
scene.background = new THREE.Color( 0x2ba5fa);
scene.fog = new THREE.FogExp2( scene.background, 0.0017 );

// Camera
let aspect = window.innerWidth / window.innerHeight;
let camera = new THREE.PerspectiveCamera(75, aspect, 0.1, 2000);

// Renderer
let renderer = new THREE.WebGLRenderer();
renderer.setPixelRatio( window.devicePixelRatio );
renderer.setSize(window.innerWidth, window.innerHeight);
document.body.appendChild(renderer.domElement);

// Controls
let controls = new THREE.OrbitControls( camera, renderer.domElement );
controls.enablePan = false;
controls.enableDamping = true;
controls.dampingFactor = 0.19;

// Add listener for window resize.
window.addEventListener('resize', onWindowResize, false);


/////////
///////// LIGHTS
/////////

// Ambient
let lightAmb = new THREE.AmbientLight( 0x212121 );
scene.add(lightAmb);

// Directional
let light = new THREE.DirectionalLight( 0xefdddd, .6 );
light.position.set( -200, 200, 0 );
/*let dlh = new THREE.DirectionalLightHelper( light );
scene.add( dlh );*/
scene.add(light);

// Point
let light2 = new THREE.PointLight( 0x99feb4, 1 );
light2.position.set (-50,150,100);
/*let plh = new THREE.PointLightHelper( light2 );
scene.add( plh );*/
scene.add(light2);

// Spot
let light3 = new THREE.SpotLight( 0xffffa2, .8 );
light3.position.set (400,100,100);
light3.angle = Math.PI / 7;
light3.penumbra = 0.8;
/*let slh = new THREE.SpotLightHelper( light3 );
scene.add( slh );*/
scene.add(light3);






/////////
///////// MATERIALS
/////////

let matCool = new THREE.MeshStandardMaterial({
  wireframe:false,
  color: 0xEF48c6
});

let matGrass = new THREE.MeshStandardMaterial({
  wireframe:false,
  color: 0x008000
  }); // + material
// Normal Lambert Phong Standard Toon

let matHills = new THREE.MeshLambertMaterial({
  wireframe:false,
  color: 0xA52A2A
  }); // + material
// Normal Lambert Phong Standard Toon

let matMountains = new THREE.MeshLambertMaterial({
  wireframe:false,
  color: 0xeeeeee
  }); // + material
// Normal Lambert Phong Standard Toon

var oceanMat = new THREE.MeshStandardMaterial( {
  color: 0x0000ff,
  side: THREE.DoubleSide,
  transparent: true,
  opacity: 0.9,
} );

/////////
///////// GEOMETRIES
/////////

// let's make the plane
let seaPlane = new THREE.PlaneGeometry(10000,10000);
//oceanMat = matCool;

let sea = new THREE.Mesh(seaPlane, oceanMat);
// let sea = new THREE.Mesh(seaPlane, matCool);
sea.rotation.x = - Math.PI/2;
sea.position.y = 10;
scene.add(sea);

// let's make the world
console.log(poly.length); // quanti poligoni
for (let p = 0; p<poly.length-1; p++) {
  //path
  let poly2d = new THREE.Shape();
  poly2d.moveTo( poly[p][1][0][0], poly[p][1][0][1] ); // primo vertice
  for (let v = 0; v<7; v++) {
    if (poly[p][1][v] != undefined)
      poly2d.lineTo( poly[p][1][v][0], poly[p][1][v][1]); // tutti i vertici
  }
  poly2d.moveTo( poly[p][1][0][0], poly[p][1][0][1] ); // primo vertice
  //extrusion
  let heightToExtrude = poly[p][0];
  let extrudeSettings = {
    steps: 1,	depth: heightToExtrude, bevelEnabled: false,
    bevelThickness: 1, bevelSize: 1, bevelSegments: 1
  };
  let path = new THREE.ExtrudeBufferGeometry( poly2d, extrudeSettings );
  let material;
  if (poly[p][2] == "green") material = matGrass;
  else if (poly[p][2] == "brown") material = matHills;
  else if (poly[p][2] == "white") material = matMountains;
  // material = matCool;
  //material = matCool;
  let extruded = new THREE.Mesh( path, material ) ;
  // Position & Rotation
  extruded.rotation.x = - Math.PI/2;
  extruded.position.x = -500;
  extruded.position.z = 300;
  scene.add( extruded );
}



////////
///////// DIRECTION
/////////

// grid helper
/*var gh = new THREE.GridHelper( 1000, 10, 0xcccccc, 0x555555 );
scene.add( gh );
gh.position.y = -0.02;
*/

// scene
camera.position.z = 500;
camera.position.y = 100;

/////////
///////// RENDER/ANIMATION LOOP
/////////

// set
let time = 0;
let render = function() {
  requestAnimationFrame(render);
  /*box.rotation.x += 0.01;
  box.rotation.y += 0.01;
  sphere.position.x = Math.cos(time)*100;
  sphere.position.y = Math.sin(time)*100;*/
  light2.position.x = -200+Math.sin(time)*300;
  light2.position.y = Math.cos(time)*300;
  time+=0.02;
  controls.update();
  renderer.render(scene, camera);
};

// go
render();


function onWindowResize() {
    camera.aspect = window.innerWidth / window.innerHeight;
    camera.updateProjectionMatrix();
    renderer.setSize(window.innerWidth, window.innerHeight);
    //controls.handleResize();
}
